import React from 'react';
import { useNav } from '../customHooks/useNav';
import './Page.css';

const Tool = () => {
	// useNav takes in a navLinkId and returns a ref
	// this ref is used to register the navLinkId that's
	// currently in view, and apply activeClass styling
	// to the corresponding nav childElement

	const toolRef = useNav('Tool');

	return (
		<section ref={toolRef} id='toolContainer'>
			<img
				src='https://source.unsplash.com/random/600x600/?food,protein'
				alt='unsplash-img'
			/>
			<div>
				<div>
					<p>Use the search tool to help you make smart decisions on food protein.</p>
					<div>
						<h3 class="title">Good Sources of Proteins</h3>
						<ul class="examples">
							<li>made my bed</li>
						</ul>
					</div>
				</div>
				<div>
					<h2 class="title"> Start Your Search!</h2>
					<ul id="victories"></ul>
					<div id="gif"></div>           
					<form action="http://httpbin.org/post" method="POST">    
					<fieldset>
						<legend>Enter your today's small victory here...</legend>  
						<textarea rows="2" cols="200" id ="victory" name ="victory_text" placeholder="For example: meditated for 1 minute"></textarea>       
						<button type="submit" class="button" id="submit">Submit</button>
					</fieldset>
					</form>
				</div>
				<div>
					<input type="text"/>
					<button>Search</button>
				</div>
			</div>
		</section>
	);
};

export default Tool;
